The equation of the hyperbola shown below can be written as
\[\frac{(x - h)^2}{a^2} - \frac{(y - k)^2}{b^2} = 1.\]Find $h + k + a + b.$

[asy]
unitsize(0.3 cm);

real upperhyper (real x) {
  return (3*sqrt((x + 1)^2/4 - 1) + 3);
}

real lowerhyper (real x) {
  return (-3*sqrt((x + 1)^2/4 - 1) + 3);
}

int i, n = 10;

for (i = -n; i <= n; ++i) {
  draw((i,-n)--(i,n),gray(0.7));
  draw((-n,i)--(n,i),gray(0.7));
}

draw((0,-n)--(0,n));
draw((-n,0)--(n,0));

draw(graph(upperhyper,-6,-3 - 0.01)--(-3,3),red);
draw(graph(lowerhyper,-9.9,-3 - 0.01)--(-3,3),red);
draw((1,3)--graph(upperhyper,1 + 0.01,4),red);
draw((1,3)--graph(lowerhyper,1 + 0.01,7.9),red);
draw(extension((-10,-10),(10,-10),(-1,3),(-1,3) + (2,3))--extension((-10,10),(10,10),(-1,3),(-1,3) + (2,3)),dashed);
draw(extension((-10,-10),(10,-10),(-1,3),(-1,3) + (2,-3))--extension((-10,10),(10,10),(-1,3),(-1,3) + (2,-3)),dashed);

dot((-1,3));
[/asy]

A square is inscribed in the ellipse
\[\frac{x^2}{3} + \frac{y^2}{6} = 1,\]so that its sides are parallel to the coordinate axes.  Find the area of the square.

[asy]
unitsize(1 cm);

draw(xscale(sqrt(3))*yscale(sqrt(6))*Circle((0,0),1));
draw((sqrt(2),sqrt(2))--(-sqrt(2),sqrt(2))--(-sqrt(2),-sqrt(2))--(sqrt(2),-sqrt(2))--cycle);
draw((-2,0)--(2,0));
draw((0,-3)--(0,3));
[/asy]

solution:
The condition $|z - 7 + 10i| \le 5$ means that $z$ lies within a circle centered at $7 - 10i$ with radius 5.  Thus, the area of $S$ is $\boxed{25 \pi}.$

[asy]
unitsize(1 cm);

filldraw(Circle((0,0),2),gray(0.7));
draw((0,0)--2*dir(30));

label("$5$", dir(30), NW);
dot("$7 - 10i$", (0,0), NW);
[/asy]

problem:
The graph of $y = \frac{p(x)}{q(x)}$ is shown below, where $p(x)$ and $q(x)$ are quadratic.  (Assume that the grid lines are at integers.)

[asy]
unitsize(0.6 cm);

real func (real x) {
  return (-(x + 5)*(x - 4)/(x - 2)^2);
}

int i;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0));
draw((0,-8)--(0,8));
draw((2,-8)--(2,8),dashed);
draw((-8,-1)--(8,-1),dashed);
draw(graph(func,-8,1.9),red);
draw(graph(func,2.1,8),red);

limits((-8,-8),(8,8),Crop);
[/asy]

